import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';
import { IoPerson, IoLockClosed, IoMail } from 'react-icons/io5';

const EditUser = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confPassowrd, setConfPassword] = useState('');
  const [role, setRole] = useState('');
  const [msg, setMsg] = useState('');
  const navigate = useNavigate();
  const { id } = useParams();

  useEffect(() => {
    const getProductById = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/users/${id}`);
        setName(response.data.name);
        setEmail(response.data.email);
        setRole(response.data.role);
      } catch (error) {
        if (error.response) {
          setMsg('Masukan Format dengan benar 1 !!!');
        }
      }
    };
    getProductById();
  }, [id]);

  const editUser = async (e) => {
    e.preventDefault();
    try {
      await axios.patch(`http://localhost:5000/users/${id}`, {
        name: name,
        email: email,
        password: password,
        confPassowrd: confPassowrd,
        role: role,
      });
      navigate('/product');
    } catch (error) {
      if (error.response) {
        setMsg('Masukan Format dengan benar !!!');
      }
    }
  };
  return (
    <div>
      <h1 className="title">Users</h1>
      <h2 className="subtitle">Update User</h2>
      <div className="card is-shadowless">
        <div className="card-content">
          <div className="content">
            <form onSubmit={editUser} className="box">
              <p className="has-tag-centered">{msg}</p>
              <div className="field">
                <label className="label">
                  <IoPerson /> Name
                </label>
                <div className="control">
                  <input type="text" className="input" value={name} onChange={(e) => setName(e.target.value)} placeholder="Name" />
                </div>
              </div>
              <div className="field">
                <label className="label">
                  <IoMail /> Email
                </label>
                <div className="control">
                  <input type="text" className="input" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Email" />
                </div>
              </div>
              <div className="field">
                <label className="label">
                  <IoLockClosed /> Password
                </label>
                <div className="control">
                  <input type="password" className="input" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="********" />
                </div>
              </div>
              <div className="field">
                <label className="label">
                  <IoLockClosed /> Confirmasi Password
                </label>
                <div className="control">
                  <input type="password" className="input" value={confPassowrd} onChange={(e) => setConfPassword(e.target.value)} placeholder="********" />
                </div>
              </div>
              <div className="field">
                <label className="Role">
                  <IoPerson /> Role
                </label>
                <div className="control">
                  <div className="select is-fullwidth">
                    <select value={role} onChange={(e) => setRole(e.target.value)}>
                      <option value="admin">Admin</option>
                      <option value="user">Users</option>
                    </select>
                  </div>
                </div>
              </div>
              <div className="field">
                <div className="control">
                  <button type="submit" className="button is-success">
                    Submit
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default EditUser;
